import React from 'react';

const Joke = (props) => {
    console.log(props.question);
    return (
        <div>
            <h3 style={{display: !props.question && "none"}}>Question: {props.question}</h3>
            <h3 style={{color: !props.question && ""}}>Answer: {props.punchLine}</h3>
            <hr />
        </div>
    )
}

export default Joke;
